import React from 'react';
import { XAxis as RechartsXAxis } from 'recharts';

const XAxisWrapper = ({ dataKey, label, ticks }) => {
  return (
    <RechartsXAxis
      dataKey={dataKey}
      label={label}
      ticks={ticks}
      tick={{ fontSize: 14, fontWeight: 500 }}
      stroke="#ccc" // Primer podešavanja stila linije tickova
    />
  );
};

export default XAxisWrapper;
